(13, 'Matrix 4', 'pelicula', 'Acosado por extraños recuerdos, la vida de Neo toma un giro inesperado al encontrarse, nuevamente, dentro de la Matrix.', , 'src=\"https://www.youtube.com/embed/kV6tJtU7znU\" title=\"Matrix 4: Resurrections (2021) Tráiler Oficial Subtitulado\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '2021', 'Acción Ciencia, Ficción');
INSERT INTO `contenidos` (`idpelicula`, `nombre`, `tipo`, `descripcion`, `img`, `link`, `fecha`, `generos`) VALUES
(14, 'Go toubun no hanayome', 'serie', 'Fuutarou Uesugi es un estudiante pobre y antisocial. Un día, consigue un trabajo como tutor de una familia rica que es nueva en la ciudad. Las futuras estudiantes de Fuutarou se revelan como sus nuevas compañeras de clase, Itsuki Nakano, y sus cuatro hermanas Quintillizas.', , 'src=\"https://www.youtube.com/embed/cYhQRTmU0aA\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '2021', 'Harem, comedia, romántica');
INSERT INTO `contenidos` (`idpelicula`, `nombre`, `tipo`, `descripcion`, `img`, `link`, `fecha`, `generos`) VALUES
(15, 'grand theft auto v', 'juego', 'GTA V (Grand Theft Auto V) para PS4, PS3, Xbox One, Xbox 360 y PC es la quinta entrega numerada de la saga superventas de Rockstar Games. Se trata de una aventura de acción de mundo abierto con multitud de misiones en la que encarnamos a tres personajes distintos: Trevor, Michael y Franklin. Además, cuenta con GTA Online, el modo multijugador en lína de GTA 5. El juego sale a la venta el 17 de septiembre de 2013 para PS3 y Xbox 360, el 18 de noviembre de 2014 en PS4 y Xbox One y, por último, el 14 de abril de 2015 para PC.', , 'src=\"https://www.youtube.com/embed/QkkoHAzjnUs\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '2013', 'Acción-aventura, Mundo abierto');
INSERT INTO `contenidos` (`idpelicula`, `nombre`, `tipo`, `descripcion`, `img`, `link`, `fecha`, `generos`) VALUES
(16, 'Naruto', 'serie', 'Es una serie Manga que cuenta la historia de un joven ninja hiperactivo llamado Naruto Uzumaki que hará todo lo posible por ascender al máximo grado ninja de su aldea con el propósito de ser reconocido como alguien importante dentro de su aldea. Dentro de él reside encerrado en su interior el Zorro de Nueve Colas (Kyubi), un demonio que atacó a la Aldea Oculta de la Hoja matando a muchas personas. Por lo que que Naruto es maltratado ahora por los ciudadanos de la aldea por considerarle como el propio Kyubi.', , 'src=\"https://www.youtube.com/embed/-G9BqkgZXRA\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '1999', 'Animación Comedia Action & Adventure ');
INSERT INTO `contenidos` (`idpelicula`, `nombre`, `tipo`, `descripcion`, `img`, `link`, `fecha`, `generos`) VALUES
(17, 'La guerra de las galaxias. Episodio I', 'pelicula', 'La Federación de Comercio ha bloqueado el pequeño planeta de Naboo, gobernado por la joven Reina Amidala, como parte de un plan ideado por Sith Darth Sidious, que manteniéndose en el anonimato dirige a los neimoidianos, que están al mando de la Federación. Amidala es convencida por los Jedis Qui-Gon Jinn y su aprendiz, o padawan, Obi-Wan Kenobi a viajar hasta Coruscant, capital de la República y sede del Consejo Jedi para intentar mediar esta amenaza. Pero esquivando el bloqueo, la nave real resulta dañada, obligando a la tripulación a aterrizar en el desértico y remoto planeta de Tatooine.', , 'src=\"https://www.youtube.com/embed/yQkeyP6BIbM\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '1999', 'Acción Aventura Ciencia Ficción');
INSERT INTO `contenidos` (`idpelicula`, `nombre`, `tipo`, `descripcion`, `img`, `link`, `fecha`, `generos`) VALUES
(18, 'League of Legends', 'juego', 'League of Legends (también conocido por sus siglas LoL) es un videojuego del género multijugador de arena de batalla en línea (MOBA) y deporte electrónico el cual fue desarrollado por Riot Games para Microsoft Windows y OS X.', , 'src=\"https://www.youtube.com/embed/aR-KAldshAE\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '2009', 'MOBA, Videojuego de rol de acción');
INSERT INTO `contenidos` (`idpelicula`, `nombre`, `tipo`, `descripcion`, `img`, `link`, `fecha`, `generos`) VALUES
(19, 'StarCraft', 'juego', 'StarCraft es un videojuego de estrategia en tiempo real de ciencia ficción militar desarrollado por Blizzard Entertainment. El primer juego de la serie StarCraft fue lanzado para Microsoft Windows el 31 de marzo de 1998.3​ Es uno de los juegos más vendidos para la computadora personal4​con más de 11 millones de copias vendidas a nivel mundial hasta febrero de 2009. Una versión para Mac OS fue lanzada en marzo de 1999, y una adaptación para el Nintendo 64, desarrollada en conjunto con Mass Media Interactive Entertainment, fue lanzada el 13 de junio del 2000.', , 'src=\"https://www.youtube.com/embed/-fuS0sskf4M\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '1998', 'Estrategia en tiempo real');
INSERT INTO `contenidos` (`idpelicula`, `nombre`, `tipo`, `descripcion`, `img`, `link`, `fecha`, `generos`) VALUES
(20, 'Dragon Ball', 'serie', 'Goku, un chico experto en artes marciales con una cola de animal, y Bulma, una joven científica, buscan reunir las siete Esferas de Dragón.', , 'src=\"https://www.youtube.com/embed/gqIEgmqljM8\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '1986', 'Acción, aventuras, fantasía');
INSERT INTO `contenidos` (`idpelicula`, `nombre`, `tipo`, `descripcion`, `img`, `link`, `fecha`, `generos`) VALUES
(21, 'Regreso al futuro', 'pelicula', 'Marty McFly es un adolescente amigo de Doc, un científico a los que todos menos él toman por chiflado. Cuando Doc crea una máquina para viajar en el tiempo en forma de un automóvil deportivo, Marty viaja accidentalmente al año 1955. Allí se encontrará con sus padres cuando eran jóvenes, pero impide su primer encuentro. A partir de entonces, y con el tiempo en su contra, McFly deberá conseguir que se enamoren para que se casen y él no deje de existir.', , 'src=\"https://www.youtube.com/embed/q27OhNUzBXk\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen', '1985', 'Aventura Ciencia Ficción Comedia');

